import React, { Component } from 'react';
import TimeLine from '../../components/projects-timeline/projects-timeline.component';
class Projects extends Component {
    render() {
        return (
            <div>
                <h1>Projects</h1>
                <TimeLine />
            </div>
        );
    }
}

export default Projects;
